import React, { Component } from 'react';
import Link from "next/link";
import styles from "./navbar.module.css";
import { HamburgerButton } from 'react-hamburger-button';
import Popup from "reactjs-popup";

const Menu = [
    {
      path: "/blog", name: "Blog",
    },
    {
      path: "/#", name: "100DaysofCode",
    },

    ]


class NavBarState extends Component {
state = {
    mobile_Menu : false
};

handleClick() {
  this.setState({
      open: !this.state.open
  });
}

    render() {
        return (
            <header className={styles.header_Wrapper}>
            <div className={styles.div_top_hypers}>
              <div className={styles.logo_left}>NdV</div>
              <ul className={styles.ul_top_hypers}>
               {Menu.map(({path, name}) => (
                <li key={name}>
                  <Link href={path} as={path}>
                    <a>{name}</a>
                  </Link>
                </li>

               ))} 
                </ul>
                 </div>
                 <div className={styles.menu_right}><HamburgerButton
	open={this.state.open}
	onClick={this.handleClick.bind(this)}
	width={18}
	height={15}
	strokeWidth={1}
	color='black'
	animationDuration={0.5}
/></div>
            </header>
        );
    }
}

export default NavBarState;
